私の個人的な出産話は﻿
誰 も が 聞 き た い と 思 う ん だ け ど（犬も食わんわい🐕）﻿
﻿
当時、2-3時間とか比較的短時間で出産が終わった反面、多分代償で傷が深くなってしまい、1年くらい体調が戻らなかった私。﻿
﻿
加えて謎の強迫観念に囚われ気持ちも落ちていて😢﻿
本当なら楽しくやるはずの初七日のお祝いやお宮参りなど、ほとんどのイベントを省略してしまいました💦﻿
﻿
ほかの人の素敵なイベント写真を見て「どうして私はできなかったのか…」なんて自分を責めたりね（←実はそんなナイーブな一面もあるのよ🤣笑）﻿
﻿
やってあげられなかったという罪悪感みたいなのもあって、身体が少しずつ復活してから、私にできることをできる範囲でやってあげたい❗️と思って作ったのがタイルの50音表でした。﻿
﻿
作ったのは数年前で、文字に積極的な娘は結構楽しんでひらがなを覚えている様子☺️﻿
﻿
できなかったことより、今できること・これからできることを数えて育児を楽しもう💕﻿
﻿
